const Dropdown = (props) => {
  const {options} = props
  return (
  <div>
    <div>Select...</div>
    <div>
      {
        options.map((option) => {
          return(<div key={option.value}>{option.label}</div>)
        })
      }
    </div>
  </div>)
}

export default Dropdown
